  <ul className="list-group list-group-flush">
    {users.map(el => (
      <li className="list-group-item" key={el.id}>
        {el.first_name}
      </li>
    ))}
  </ul>
};

const mapStateToProps = (state) => (
  { users: state.users }
);

export default connect(mapStateToProps)(ListUsers);


